import React from "react";
import "./Person.css"
const person = (props) => {
    conso
    return (
        <div className = "Person" onClick = {props.click} >
            <h1>I am {props.name} and I am {props.age}</h1>
            <input className = "centeredText" type = "text" value = {props.name} onChange = {props.changed}></input>
        </div>
    )
};

export default person;

/*Above we have used two way binding i.e we have provided value as well as we are also changing the value*/
